import React, {useState } from 'react';
import ReactDOM from 'react-dom/client';
import Axios from "axios";
const App = () => {
    const [data,setData]=useState("");
    const getData=async()=>{
        const response=await Axios.get("http://localhost:5000/getData");
        setData(response.data);
    }

    useEffect(() => {
        getData()

    },[]);
    return (
        <div>{data}</div>
    )
}

export default App;
